import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './startups.css';

//Startup json from the backend
var team = {
     'member1': {
          'image':false, 
          'name':'Okorite Briggs', 
          'position':'Backened Developer'
     },
     'member2': {
          'image':false, 
          'name':'Hanif Adedotun', 
          'position':'Frontend Developer & Graphics Designer'
     },
     'member3': {
          'image':false, 
          'name':'David Utee Usiere', 
          'position':'Frontend Developer & Scribe'
     },
     'member4': {
          'image':false, 
          'name':'Fortune Aliebiesu', 
          'position':'Backened Developer'
     }
}

class startups extends React.Component {
     render(){
          return(
          <div>Startups</div>
          )
     }
}
export default startups;
